import React from "react";

import './Navbar.css' 
const Navbar = () =>{
    return(
        <div className="navbar_background">
            <div className="navbar">
                <div>
                    <div className="navbar_login">SING IN</div>
                    <div className="navbar_registartion">SING UP</div>
                </div>
            </div>
        </div>
    )
}

export default Navbar;
